import Home from "../pages/index.js";

const number = (state = 0, action) => {
	switch(action.type) {
		case "ADDTODATABASE":
		// add to database, need whatever the number is
			state = this.state.milliSecondsElapsed/100;
			return state;
		case "DONOTHING":
			return state;
	}
}

export default number;
